import React from 'react';
import logo from '/pictures/logo.png'; // Use the correct path

const Header = () => {
  return (
    <section className="relative min-h-screen w-full bg-cover bg-center" style={{ backgroundImage: `url(/pictures/bgkape.jpg)` }}>
      <nav className="flex justify-between items-center p-4 bg-opacity-50 bg-gray-900">
        <img src={logo} alt="Logo" className="w-24 h-24 rounded-full" />
        {/* Other content */}
      </nav>
      {/* Other content */}
    </section>
  );
};

export default Header;
